import React from 'react'
import './App.css'
import fetch from 'fetch'

class App extends React.Component() {
  constructor (props) {
    super(props)
    this.state = {}
  }

  handleClick () {
    fetch('http://weather.livedoor.com/forecast/webservice/json/v1?city=400040')
      .then(function (response) {
        return response.json()
      })
      .then(function (myJson) {
        console.log(JSON.stringify(myJson))
      })
  }

  render () {
    ;<div className='app'>
      <button onClick={this.handleClick}>天気取得</button>
    </div>
  }
}

export default App
